function CallGetDetails(){var n=GetSearchParam();HttpPost(`/ApprovalProcess/GetDetails`,"html",n,function(n){$("#LoadReportView").html("");$("#LoadReportView").html(n)})}function GetSearchParam(){return{userid:1}}function GetApprovalProccessList(n){HttpGet(`/ApprovalProcess/GetApprovalProcessDetails/?worktemplateId=${n}`,"json",function(n){window.location=n})}$(document).ready(function(){CallGetDetails();$(".btnclick").click(function(){var n=$(this).val();$("#ddlModuleWise").val(n).trigger("change")})});